import React from 'react'
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider'
import AppBar from 'material-ui/AppBar'
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListSubheader from '@material-ui/core/ListSubheader';
import ListItemText from '@material-ui/core/ListItemText';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';

const style = makeStyles((theme) => ({
    button: {
      '& > *': {
        margin: theme.spacing(1),
      },
    },
  }));

function AvailabilityDetails({...props}) {

    const continueToNext = e => {
        e.preventDefault()
        props.nextStep()
    }
    const {avails, handleReservation} = props

    const showAvails = () => {
        for (const key in avails.openTimes) {
            const employeeName = avails.employeeInfo[key].name
            console.log(employeeName)
            const times = avails.openTimes[key]
            return (
                <div className={style().button}>
                    <br/>
                    <h4>{employeeName}</h4>
                    {
                        times.map(slot => 
                            <Button key={slot} onClick={handleReservation(slot)} size="small" variant="contained" color="primary">
                                {slot[0] + " - " + slot[1]}
                                </Button>
                        )}
                </div>
            )

        }

    }
    const listAvails = (key) => {
        const times = avails.openTimes[key]
        console.log(times)
        times.map(slot => {
            const text = slot[0] + " to " + slot[1]
            console.log(text)
            return (
                <ListItem button>
                    <ListItemText primary={text}/>
                </ListItem>
            )
        })

    }

    return (
        <MuiThemeProvider>
            <div>
                <AppBar title= "Enter User Info"></AppBar>
                    {showAvails()}

            </div>
        </MuiThemeProvider>
    )
}

const flexContainer = {
    display: 'flex',
    flexDirection: 'row',
    padding: 0,
  };
export default AvailabilityDetails
